import React, {useState} from "react";

function Note(props) {

    const state = useState();

    return (
    <div className="note">
        <h1>{props.h}</h1>
        <div className="note-img-div">
        <img src={props.imgURL}></img>
        </div>
        <p>{props.p}</p>
    </div>
    );
}

export default Note;
